import React from "react";


function page() {
  return (
    <>
      <div className='navigation'>
        <div className='profile'>
            <img src={require("./components/logo192.png")} alt="" srcset="" />
        </div>
        <div className="navlist"></div>
      </div>
      <div className='main'></div>
      <div className='statistic'></div>
    </>
  );
}

export default page;
